script: |
  super -f tsv -I q1417.sql | sort > q1417.out

vector: true

inputs:
  - name: q1417.sql
    data: |
      SELECT e6, e8+376, x4, x9, e5*680, d2+210, d3
      FROM t8, t6, t9, t2, t4, t5, t3
      WHERE a3 in (651,964,197,234,995,364,478)
      AND a2 in (543,324,253)
      AND e8=a5
      AND c9 in (126,992,732,811,327,800,87)
      AND (b4=810 OR b4=849 OR 653=b4 OR b4=288)
      AND (18=c5 OR c5=31 OR 915=c5)
      AND d6=d9;
  - name: t2
  - name: t3
  - name: t4
  - name: t5
  - name: t6
  - name: t8
  - name: t9

